        return(


        <Grid  item sm={3} xs={8} className="infoDiv">
            <div className="harvestContactDiv">
                <p>{label}</p>
                <p>Contact: {farmer}</p>
            </div>
        </Grid>
        )

    }


    return (



            <Grid  item sm={3} xs={8} className="harvestDiv">
                <button onClick={handleClick} className="harvestImgDiv" >
                    <img  className="harvestImg" width="50" src={image} alt="harvest-photo"/>
                </button>
            </Grid>

    )

    }

